const Login = () => (
    <nav>
        <h2>Inventory Login</h2>
        <p>Sign in to manage your store's inventory.</p>
        <button className="github" onClick={() => this.props.authenticate('Github')}>Log In With Github</button>
    </nav>
);

export default Login;
